if(!function_exists("mb_strlen"))
{
    function mb_strlen($string, $encoding = NULL)
    {
        return strlen($string);
    }
}

if(!function_exists("mb_substr"))
{
    function mb_substr ($str , $start, $length = NULL, $encoding = NULL)
    {
        return substr ($str, $start, $length);
    }
}

if(!function_exists("mb_strtoupper"))
{
    function mb_strtoupper($str, $encoding = NULL)
    {
        return strtoupper($str);
    }
}

abstract class SmsAdapter
{
    protected $db;
       
    public function setDb($db)
    {
        $this->db = $db;
    }
    
    public function Execute($sql)
    {
        return $this->db->query($sql);
    }
    
    public function lastInsertId()
    {
        return $this->db->getLastId();
    }
    
    public function escape($value)
    {
        return $this->db->escape($value);
    }
    
    protected function getPrefix()
    {
        $country_prefix = array(0 => "");
        
        $result = $this->Execute("SELECT * FROM ".DB_PREFIX."country");
        if ($result->num_rows)
        {
            foreach ($result->rows as $row)
            {
                if(array_key_exists($row["iso_code_2"], SmsVariables::$isoToCallPrefix))
                {
                    $country_prefix[$row["country_id"]] = SmsVariables::$isoToCallPrefix[$row["iso_code_2"]];   
                }
            }
        }
        return $country_prefix;
    }
    
    public function getDefaultPrefix()
    {
        $prefix = NULL;

        $result = $this->Execute("SELECT * FROM ".DB_PREFIX."setting WHERE `key` = \"config_country_id\";");
        
        if($result->num_rows)
        {
            foreach($result->rows as $row)
            {
                if((isset($row["store"]) && $row["store"] == 0) || !isset($row["store"]))
                {
                    $result = $this->Execute("SELECT iso_code_2 FROM ".DB_PREFIX."country WHERE country_id = '".$this->escape($row["value"])."'");

                    if($result->num_rows && isset(SmsVariables::$isoToCallPrefix[$result->row["iso_code_2"]]))
                    {
                        $prefix = SmsVariables::$isoToCallPrefix[$result->row["iso_code_2"]];
                    }
                }
            }
        }
                
        return $prefix;
    }
}

class HooksExtensionsBase extends SmsAdapter
{
    protected $variables = array();
    
    public function __construct($db, $variables)
    {
        $this->setDb($db);
        $this->variables = $variables;
        
        if(method_exists($this, "variables"))
        {
            $this->variables();
        }
    }   
        
    protected function setVariable($name, $value = null, $alternative = null)
    {
        if(!isset($this->variables["{" . $name . "}"]))
        {
            if(is_numeric($value))
            {
                if($value !== null)
                {
                    $this->variables["{" . $name . "}"] = $value;
                }
                elseif($alternative !== null)
                {
                    $this->variables["{" . $name . "}"] = $alternative;
                }
            }
            else
            {
                if(strlen((string)$value) > 0)
                {
                    $this->variables["{" . $name . "}"] = $value;
                }
                elseif(strlen((string)$alternative) > 0)
                {
                    $this->variables["{" . $name . "}"] = $alternative;
                }
            }
        }

        return;
    }

    protected function getVariable($name)
    {
        if(isset($this->variables["{" . $name . "}"]))
        {
            return $this->variables["{" . $name . "}"];
        }
        return 0;
    }
    
    public function getVariables()
    {
        return $this->variables;
    }
}

